  [],\n\t\"num_tags\": 0,\n\t\"name\": \"noaas-coastal-change-analysis-program-c-cap-1985-to-2010-regional-land-cover-change-data-coast\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA Coastal Change Analysis Program
  (C-CAP) produces national standardized land cover and change products for the coastal
  regions of the U.S. C-CAP products inventory coastal intertidal areas, wetlands,
  and adjacent uplands with the goal of monitoring changes in these habitats, on a
  one-to-five year repeat cycle. C-CAP data exists nationwide for the coastal regions
  of the lower 48 states for 1996, 2001, 2006, and 2010, and in selected locations
  for 1985 and 1992. These maps are developed utilizing Landsat Thematic Mapper imagery,
  and can be used to track changes in the landscape through time. This trend information
  gives important feedback to managers on the success or failure of management policies
  and programs and aid in developing a scientific understanding of the Earth system
  and its response to natural and human-induced changes. This understanding allows
  for the prediction of impacts due to these changes and the assessment of their cumulative
  effects, helping coastal resource managers make more informed regional decisions.
  NOAA C-CAP is a contributing member to the Multi-Resolution Land Characteristics
  consortium and C-CAP products are included as the coastal expression of land cover
  within the National Land Cover Database.nnPurpose: C-CAP is dedicated to the development,
  distribution, and application of land cover and change data for the coastal regions
  of the U.S. This effort is being conducted in close coordination with state coastal
  management agencies, the interagency Multi-Resolution Land Characteristics (MRLC)
  consortium, and the National Land Cover Database (NLCD).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
